import React from 'react';
import './Input.css';

function Input(props) {



  return(
    <input
      type = {props.type === undefined ? 'text' : props.type} 
      placeholder = {props.username}
      type = {props.type}
      className = "input-field"
    />
  )
}

export default Input;
